import React from 'react';
import{Link} from 'react-router-dom';

const ShopDisplay = (props)=>{
    const listFaishon = ({faishonData}) =>{
        if(faishonData){
            return faishonData.map((item)=>{
              <Link to ='/' key={item.faishontype_id}>
                  return(
                    <div class="faishontype">
                        <h2 class="faishon-heading">Western Wear</h2>
                        <img src="https://adn-static1.nykaa.com/nykdesignstudio-images/pub/media/catalog/product/9/6/tr:w-300,/96399c6NK_GAJRA00004594_1.jpg" class="css-p3bt1g" width="300" height="400" alt="" srcset="https://adn-static1.nykaa.com/nykdesignstudio-images/pub/media/catalog/product/9/6/tr:w-300,/96399c6NK_GAJRA00004594_1.jpg 1x, https://adn-static1.nykaa.com/nykdesignstudio-images/pub/media/catalog/product/9/6/tr:w-600,/96399c6NK_GAJRA00004594_1.jpg 2x, https://adn-static1.nykaa.com/nykdesignstudio-images/pub/media/catalog/product/9/6/tr:w-900,/96399c6NK_GAJRA00004594_1.jpg 3x" loading="eager" decoding="async" id="73450995">
                        </img>
                        <a>shop now</a>
                    </div>
                )
              </Link>
            })
        }
    }

    return(
        
        <div class="content">
           {listFaishon(props)}
            </div>
            
    )

  
}
export default ShopDisplay;
